    ref: ISO 19135:2005
  concept: 90925aba-7683-5966-aff6-6edc9cbd2285
  definition: заявление о том, что учетная единица    реестра более не пригодна к
    использованию при производстве новых данных
  examples: []
  notes:
  - Статус изъятой из обращения учетной единицы варьируется от категории «действительный»
    до - «изъятый из обращения». Изъятая из обращения учетная единица остается в реестре
    для поддержания интерпретации данных, созданных до ее изъятия из обращения
